import 'react-native-gesture-handler';
import React from 'react';
import { StyleSheet, Text, View, Button, SafeAreaView, TouchableOpacity } from 'react-native';
import JourneyScreen from './JourneyScreen';

export default class HappinessTree extends React.Component {
	render() {
		return (
			<SafeAreaView style={styles.container}>
				<Text>
					HappinessTree
				</Text>
        
        <Tree
          navigation={this.props.navigation}
        />
			</SafeAreaView>
		)
	}
}

class Tree extends React.Component {
  render() {
    const { navigate } = this.props.navigation
    return (
      <View style={styles.view}>
        
        <TouchableOpacity
          style={styles.journeyButton}
          onPress={() => navigate('Journey', {
            journey: JourneyGraditude
          })}>
          <Text>Graditude</Text>
        </TouchableOpacity>

        <TouchableOpacity
          style={styles.journeyButton}
          onPress={() => navigate('Journey', {
            journey: JourneySelfCare
          })}>
          <Text>Self-care</Text>
        </TouchableOpacity>
      </View>
    );
  }
}

const JourneyGraditude = {
  name: "Graditude",
  exercise: [
    {
      name: "Practice graditude",
      directions: "Write 5 things you are grateful for right now",
    },
    {
      name: "Meditate",
      directions: "Close your eyes for 2-5 mins and try ",
    },
  ]
}

const JourneySelfCare = {
  name: "Self-care",
  exercise: [
    {
      name: "Practice self-care",
      directions: "Take a 5 min break, make yourself comfortable and rest.",
    },
    {
      name: "Screen Break",
      directions: "Take a break from the screens and let your eyes to rest",
    },
  ]
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center'
  },
  view: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  },
  journeyButton: {
    width: 200,
    marginRight: 40,
    marginLeft: 40,
    marginTop: 10,
    paddingTop: 10,
    paddingBottom: 10,
    backgroundColor: '#42A5F5',
    borderRadius: 10,
    borderWidth: 2,
    borderColor: '#fff',
    alignItems: 'center'
  }
})
